package com.soldesk.order.login;

public class GoogleVO {

	
	private String goo_id;
	private String goo_name;
	private String goo_email;
	
	public GoogleVO() {
		super();
		// TODO Auto-generated constructor stub
	}

	public GoogleVO(String goo_id, String goo_name, String goo_email) {
		super();
		this.goo_id = goo_id;
		this.goo_name = goo_name;
		this.goo_email = goo_email;
	}

	public String getGoo_id() {
		return goo_id;
	}

	public void setGoo_id(String goo_id) {
		this.goo_id = goo_id;
	}

	public String getGoo_name() {
		return goo_name;
	}

	public void setGoo_name(String goo_name) {
		this.goo_name = goo_name;
	}

	public String getGoo_email() {
		return goo_email;
	}

	public void setGoo_email(String goo_email) {
		this.goo_email = goo_email;
	}
	
	
	
	
	
}
